// The Menu Bar on the app 
import React from 'react'

function Navbar() {
    return (
        <div className='navBar'>
            <nav>
                <div className='logo'>
                <p>
                    Alpha+
                </p>
                </div>
            </nav>
        </div>
    )
}

export default Navbar
